import React from "react";
import { Container, Row, Col } from "react-bootstrap";


function StoreData() {
    return (
        <>
            <Container fluid="md" style={{backgroundColor:"black",color:"white"}}>
            <h1>Register New User</h1>
                <Row>
                    <Col> <label></label></Col>
                </Row>

            </Container>

        </>
    )
}

export default StoreData;
